<script type="text/javascript">
    $(document).ready(function(){
        
        let value = 0;
        let checkbox_credits_count = 0;
        let stages_str = "";

        $(document).on('change', '.with-gap', function(){
            if ($(this).is(':checked')) {
                let name = $(this).data('name');
                value = parseInt($(this).data('price'));
                stages_str = '<div class="divider-light"></div><p class="tuning-resume">'+name+' <small>'+value+' credits</small></p>';
                $('#rows-for-credits').html(stages_str);
                $('#total-credits').html(value+checkbox_credits_count);
                $('#total_credits_to_submit').val(value+checkbox_credits_count);
                
            }
        });

        $(document).on('click','input[type="checkbox"]',function(){
            checkbox_credits_count = 0;
            let options_str = '';
            $('#rows-for-credits').html(stages_str);
            $('input[type="checkbox"]').each(function () {
                if($(this).prop("checked") == true){
                    checkbox_credits_count +=  parseInt($(this).data('price'));
                    let name = $(this).data('name');
                    options_str += '<div class="divider-light"></div><p class="tuning-resume">'+name+' <small>'+$(this).data('price')+' credits</small></p>';
                }
            });

            // let stages_str = '<div class="divider-light"></div><p class="tuning-resume">'+name+' <small>'+value+' credits</small></p>';
            
            $('#rows-for-credits').append(options_str);           
            $('#total-credits').html(value+checkbox_credits_count);
            $('#total_credits_to_submit').val(value+checkbox_credits_count);

            // if($(this).prop("checked") == true){
            //     console.log("Checkbox is checked.");
            // }
            // else if($(this).prop("checked") == false){
            //     console.log("Checkbox is unchecked.");
            // }
        });

        // console.log(value);
        //     console.log(checkbox_credits_count);
